javascript:(async()=>{let e=document.querySelector("[id^=ptModFrame]"),t=e.contentDocument||iframe.contentWindow.document,n=t.querySelector("#SSR_CLS_DTL_WRK_CLASS_NBR").textContent,o=t.querySelector("[id^=MTG_SCHED]").textContent.split(" "),c=o[0],i=o.slice(1).join(" ")||"Flexible",r=t.querySelector("[id^=MTG_LOC]").textContent.replace(" INTERNET",""),l=t.querySelector("[id^=MTG_DATE]").textContent;await navigator.clipboard.writeText(`section: ${n}\ndays: ${c}\ntimes: ${i}\nlocation: ${r}\ndates: ${l}`),alert("Data copied to clipboard!")})();